import React from 'react'
import {PhotoAlbum} from 'styled-icons/material-outlined';


import {
    Container,
    Body,
    Content,
    Texto,
    Icons,
    Icon

  } from './styles';

const Input : React.FC = () =>  {
    return (  

        <Container>
            <Body>
                <Content>
                    <Texto placeholder="Procurar por um evento" />
                </Content>
            </Body>
            <Icons>
                <Icon>
                    <PhotoAlbum />
                </Icon>
            </Icons>
        </Container>

    );
};

export default Input;
